<div class="entities" style="line-height: 2.5; direction: ltr">Synergistic effect of interleukin 1 alpha on nontypeable Haemophilus influenzae-induced up-regulation of human beta-defensin 2 in middle ear epithelial cells . BACKGROUND : We recently showed that beta-defensins have antimicrobial activity against nontypeable Haemophilus influenzae ( NTHi ) and that interleukin 1 alpha ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01583
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) up-regulates the transcription of beta-defensin 2 ( DEFB 4 according to new nomenclature of the Human Genome Organization ) in human middle ear epithelial cells via a Src-dependent Raf - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q02750
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 / 2 -

    P29323
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 signaling pathway . Based on these observations , we investigated if human middle ear epithelial cells could release 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01583
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 upon exposure to a lysate of NTHi and if this cytokine could have a synergistic effect on beta-defensin 2 up-regulation by the bacterial components . METHODS : The studies described herein were carried out using epithelial cell lines as well as a murine model of acute otitis media ( OM ) . Human cytokine macroarray analysis was performed to detect the released cytokines in response to NTHi exposure . Real time quantitative PCR was done to compare the induction of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 or beta-defensin 2 mRNAs and to identify the signaling pathways involved . Direct activation of the beta-defensin 2 promoter was monitored using a beta-defensin 2 promoter-Luciferase construct . An 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01583
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 blocking antibody was used to demonstrate the direct involvement of this cytokine on DEFB 4 induction . RESULTS : Middle ear epithelial cells released 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01583
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 when stimulated by NTHi components and this cytokine acted in an autocrine / paracrine synergistic manner with NTHi to up-regulate beta-defensin 2 . This synergistic effect of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 on NTHi-induced beta-defensin 2 up-regulation appeared to be mediated by the p38 Q96HU1 kinase pathway . CONCLUSION : We demonstrate that 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 is secreted by middle ear epithelial cells upon exposure to NTHi components and that it can synergistically act with certain of these molecules to up-regulate beta-defensin 2 via the p38 Q96HU1 kinase pathway .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Dopamine-related genes and spontaneous smoking cessation in ever-heavy smokers . Several studies have provided evidence for associations of polymorphisms located in and near dopamine-related genes and nicotine dependence and other smoking-related phenotypes , including pharmacogenetic interactions . AIM : The purpose of the present work was to examine the association of SNPs in the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P20711
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ( DDC ) , dopamine receptor D2 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P14416
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) and dopamine transporter ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q01959
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) genes with smoking cessation in a large retrospective study featuring approximately 900 cessation events . MATERIALS &amp; METHODS : Data originated from the enrollment questionnaire of the epidemiological ESTHER study of community-dwelling adults aged 50-74 years , conducted in the German state of Saarland between July 2000 and December 2002 . Restricting the analyses to subjects who reported to have regularly smoked &gt; 20 cigarettes per day at some point in their life , we used survival analysis methods to model the time from initiation of regular smoking to cessation ( defined as quitting with abstinence lasting until enrollment ) and its relation with eight polymorphisms in the aforementioned genes ( five in DDC , two in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P14416
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and one in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q01959
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) in 1446 participants . RESULTS : Neither individual variants nor DDC haplotypes were associated with the probability of overcoming nicotine dependence in this cohort . CONCLUSION : The repeated suggestion of associations between the variants examined and nicotine dependence in previous reports seems to contrast the negative results in the present study . This would appear consistent with the hypothesis that the establishment of regular heavy smoking might abolish associations between genetic determinants of nicotine dependence and nicotine dependence-related phenotypes , in particular the probability of successful smoking cessation .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Phosphodiesterase - 4 inhibitors as a novel approach for the treatment of respiratory disease : cilomilast . Phosphodiesterase - 4 ( DB05876 ) is an important DB02527 - metabolising enzyme in immune and inflammatory cells , airway smooth muscle and pulmonary nerves . The phosphodiesterase 4 ( DB05876 ) enzyme plays a significant role in modulating the activity of DB02527 , an important second messenger that mediates the relaxation of airway smooth muscle and suppresses inflammatory cell function , thereby attenuating the inflammatory response . Selective inhibitors of this enzyme show a broad spectrum of activity in animal models of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P48444
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and asthma . These drugs block the hydrolysis of DB02527 via inhibition of DB05876 and are attractive candidates for novel anti-inflammatory drugs . At present , two second-generation DB05876 inhibitors for the treatment of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P48444
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and asthma patients are being tested in clinical Phase III trials . The most advanced compound is the orally active , selective DB05876 inhibitor cilomilast ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB03849
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 , SB - 207499 , cis - 4 - cyano - 4 - [ 3 - cyclopentyloxy - 4 - methoxyphenyl ] - cyclohexanecarboxylic acid ; GlaxoSmithKline ) . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB03849
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 shows high selectivity for DB02527 - specific DB05876 , an isoenzyme that predominates in pro-inflammatory and immune cells and that is 10 - fold more selective for 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q08499
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 than for 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P27815
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , - B or - C . In vitro , cilomilast suppresses the activity of several pro-inflammatory and immune cells that have been implicated in the pathogenesis of asthma and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P48444
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 . Moreover , it is highly active in animal models of these diseases . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 has been shown to exert potent anti-inflammatory effects both in vitro and in vivo . It is orally active and may be effective in the treatment of asthma and

 ; however , complete assessment of the therapeutic value of this novel compound class must await the outcome of longer-term clinical trials . This review presents a summary of the preclinical and clinical profile of cilomilast in patients with

 .</div>
